dts:
declare module 'react' {
  import React from 'react';
  export const ReactElement: any;
  export function useCallback(callback: (...args: any[]) => void, deps?: any[]): any;
  export function useEffect(effect: () => void | (() => void) & Disposable, deps?: any[]): any;
  export function useMemo<T>(factory: () => T, deps?: any[]): T;
  export function useState<S>(initialState: S): [S, Dispatch<SetStateAction<S>>];
}

declare module 'react-native-gesture-handler' {
  import * as React from 'react';
  export const GestureHandlerRootView: React.FC<any>;
}

declare module 'react-native-reanimated' {
  import * as React from 'react';
  export const FlatList: React.FC<{
    data: any[];
    renderItem: ({ item }: { item: any }) => React.ReactNode;
    keyExtractor?: (item: any) => string;
  }>;
  export const ScrollEvent: React.RefObject<ScrollEvent>;
  export const View: React.FC<{
    style?: any;
  }>;
  export function runOnJS(fn: (...args: any[]) => void): void;
  export function useAnimatedScrollHandler(): AnimatedScrollHandler;
  export function useAnimatedStyle(style: any): any;
  export function useSharedValue(initialValue: number): SharedValue<number>;
  export function withTiming(value: number, config?: TimingConfig): Promise<void>;
}
